import './StudentCorner.css';

const testimonials = [
  {
    name: "Priya Sharma",
    batch: "BCA 2022",
    message: "Amazing faculty and campus life! I learned a lot here."
  },
  {
    name: "Aman Gupta",
    batch: "M.Sc. 2021",
    message: "The labs and library facilities are top-notch."
  },
  {
    name: "Ankit Soni",
    program: "M.Sc. CS (2024)",
    review: "The faculty members are always ready to guide and mentor. Labs are very well equipped too.",
  },
  {
    name: "Harshita Jain",
    program: "B.Com (Hons.) 2023",
    review: "The commerce department has a great teaching approach, and I loved participating in fests!",
  },
  {
    name: "Mohit Parmar",
    program: "B.Sc. Physics",
    review: "Physics labs and experiments gave us a lot of practical insights. Loved the exposure through national seminars.",
  },
  {
    name: "Riya Shah",
    program: "BBA 2025",
    review: "Case studies and presentations prepared me well for internships and interviews. Highly recommend the program!",
  },
  {
    name: "Imran Qureshi",
    program: "BA English 2024",
    review: "From poetry to post-colonial literature, the content was rich and the discussions were engaging."
  }
];



function StudentCorner() {
  return (
    <div className="student-corner">
      <h1>Student Corner</h1>
      <div className="testimonial-section">
        {testimonials.map((t, i) => (
          <div className="testimonial" key={i}>
            <h3>{t.name}</h3>
            <p><strong>{t.batch}</strong></p>
            <p>{t.message}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default StudentCorner;
